import { FormGroup, Input } from "reactstrap";
import React from "react"; 
import { Row } from "simple-flexbox";
import { useForm } from "react-hook-form";

function CreateTicket() 
{

    const methods = useForm(); 

    const onSubmit = (data) => {
        console.log(JSON.stringify(data, null, 2)); 
    }
    return(
        <div>
            <form className="smallForm" onSubmit={methods.handleSubmit(onSubmit)}>
                <h2>Create Support Ticket</h2>
                <FormGroup>
                    <label>What is your problem?</label>
                    <Input
                        required
                        type="text"
                        name="ticket_title"
                        innerRef={methods.register}
                    />
                </FormGroup>
                <FormGroup>
                    <label>Can you describe what the issue is?</label>
                    <Input 
                        required
                        type="textarea"
                        name="ticket_desc"
                        innerRef={methods.register}
                    />
                </FormGroup>
                <FormGroup>
                    <label>How serious is this problem</label>
                    <Input
                        required
                        type="select"
                        name="ticket_priority"
                        innerRef={methods.register}
                    >
                    <option>LOW</option>
                    <option>MEDIUM</option>
                    <option>HIGH</option>
                    </Input>
                </FormGroup>
                <Row horizontal="center">
                <button type="submit">Create Support Ticket</button>
                </Row>
            </form>
        </div>
    )
}

export default CreateTicket;
